import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import Mainpage from "../components/Jumbotron";

class Main extends Component {
    state = {};
    render() {
        return (
            <Container id="main">
                <Row>
                    <Col>
                        <Mainpage />
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default Main;
